import React from 'react'

const CurrentForcast = ({ hourlyForcast }) => {
    let currentForcast = hourlyForcast.map((hour, i) => {
        return (
            <div key={i}>
                <h1>{hour}</h1>

            </div>
        )
    })
    return (
        <div>
            <div>{currentForcast}</div>
        </div>
    )

}
export default CurrentForcast
